import React from 'react';
import styles from './ModalUpdate.module.css';

const ModaUpdate = () => {
  return (
    <div className={styles.containerBackGround}>
      <div className={styles.container}>
        <div className={styles.containerAux}></div>
        <div>
          <Input type="text" placeholder="Filme" />
          <Input type="text" placeholder="Genero" />
          <Input
            type="text"
            placeholder="Foto"
            onChange={({ target }) => setFoto(target.value)}
          />
          <Input type="text" placeholder="Duração" />

          <Button text="Finish" />
        </div>
      </div>
    </div>
  );
};

export default ModaUpdate;
